import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [page, setPage] = useState('home');
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [content, setContent] = useState({});
    const [editContent, setEditContent] = useState({});
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    useEffect(() => {
        fetchContent();
    }, []);

    const fetchContent = async () => {
        try {
            const res = await axios.get('http://localhost:5000/api/content');
            setContent(res.data);
            setEditContent(res.data);
        } catch (err) {
            console.log(err);
        }
    };

    // LOGIN PAGE
    if (page === 'login') {
        return (
            <div style={styles.loginContainer}>
                <div style={styles.loginBox}>
                    <h2 style={styles.loginTitle}>Admin Login</h2>
                    <input 
                        placeholder="Email" 
                        value={email} 
                        onChange={(e) => setEmail(e.target.value)}
                        style={styles.input}
                    />
                    <input 
                        type="password" 
                        placeholder="Password" 
                        value={password} 
                        onChange={(e) => setPassword(e.target.value)}
                        style={styles.input}
                    />
                    <button onClick={async () => {
                        const res = await axios.post('http://localhost:5000/api/auth/login', { email, password });
                        if (res.data.success) {
                            setIsLoggedIn(true);
                            setPage('admin');
                        } else {
                            alert('Invalid credentials');
                        }
                    }} style={styles.loginBtn}>
                        Login
                    </button>
                    <button onClick={() => setPage('home')} style={styles.backBtn}>
                        Back to Home
                    </button>
                </div>
            </div>
        );
    }

    // ADMIN PANEL
    if (page === 'admin' && isLoggedIn) {
        return (
            <div style={styles.adminContainer}>
                <div style={styles.adminHeader}>
                    <h2>Edit Content</h2>
                    <button onClick={() => {
                        setIsLoggedIn(false);
                        setPage('home');
                    }} style={styles.logoutBtn}>
                        Logout
                    </button>
                </div>
                {Object.keys(editContent).map(key => (
                    <div key={key} style={styles.editSection}>
                        <label style={styles.label}>{key}</label>
                        <textarea
                            value={editContent[key] || ''}
                            onChange={(e) => setEditContent({...editContent, [key]: e.target.value})}
                            rows="3"
                            style={styles.textarea}
                        />
                    </div>
                ))}
                <button onClick={async () => {
                    await axios.put('http://localhost:5000/api/content', editContent);
                    setContent(editContent);
                    alert('Saved!');
                    setPage('home');
                }} style={styles.saveBtn}>
                    Save Changes
                </button>
            </div>
        );
    }

    // HOME PAGE - EXACT UI LIKE SCREENSHOT
    return (
        <div style={styles.app}>
            {/* Navbar */}
            <nav style={styles.navbar}>
                <h2 style={styles.logo}>VIGHNAHARTA INFINITY</h2>
                <button onClick={() => setPage('login')} style={styles.adminBtn}>
                    Admin
                </button>
            </nav>

            {/* Hero Section - Like Screenshot */}
            <div style={styles.hero}>
                <div style={styles.heroOverlay}>
                    <h1 style={styles.heroTitle}>THINKING OF A FANTASTIC VICINITY?</h1>
                    <p style={styles.heroSubtitle}>20+ PODIUM LUXURIOUS AMENITIES | SPACIOUS BALCONY HOMES*</p>

                    <div style={styles.priceCards}>
                        <div style={styles.priceCard}>
                            <h3>SMART 1 BHK</h3>
                            <p style={styles.price}>@ 74.99 Lacs*</p>
                            <p style={styles.priceOld}>69.99 Lacs* onwards</p>
                        </div>
                        <div style={styles.priceCard}>
                            <h3>PREMIUM 2 BHK</h3>
                            <p style={styles.price}>@ 1.05 CR*</p>
                            <p style={styles.priceOld}>96.99 Lacs* onwards</p>
                        </div>
                    </div>

                    <p style={styles.location}>BLOG NO. 223/224, CIRCLE: KANNAMWAR NAGAR I, VIKHIROLI (EAST)</p>
                </div>
            </div>

            {/* About Project */}
            <div style={styles.section}>
                <h2 style={styles.sectionTitle}>About Project</h2>
                <p style={styles.aboutText}>{content.about || 'At Vighnaharta Enclave, every detail reflects the grandeur of life...'}</p>
                <p style={styles.aboutText}>"{content.aboutQuote || 'The moment I entered the house, it felt welcomed'}"</p>
                <button style={styles.brochureBtn}>Download Brochure</button>
            </div>

            {/* Amenities */}
            <div style={{...styles.section, backgroundColor: '#f8f9fa'}}>
                <h2 style={styles.sectionTitle}>Amenities</h2>
                <p style={styles.amenitiesSub}>Thoughtfully crafted surroundings that reflect tradition, comfort, and a human-centered design approach.</p>

                <div style={styles.amenitiesGrid}>
                    {['Gymnasium', 'Kids Play Area', 'Swimming Pool', 'Jogging Track', 'Yoga Deck', 'Garden'].map(item => (
                        <div key={item} style={styles.amenityCard}>
                            <div style={styles.amenityIcon}>üèóÔ∏è</div>
                            <p>{item}</p>
                        </div>
                    ))}
                </div>
            </div>

            {/* Explore More Buildings */}
            <div style={styles.section}>
                <h2 style={styles.sectionTitle}>Explore More Buildings in the Township</h2>
                <div style={styles.buildingsGrid}>
                    {['Maharsa Aradhya', 'Vignaharta Enclave', 'Vignaharta Heights'].map((item, i) => (
                        <div key={i} style={styles.buildingCard}>
                            <img src={`/images/building${i+1}.jpg`} alt={item} style={styles.buildingImg} />
                            <p style={styles.buildingName}>{item}</p>
                            <p style={styles.buildingTag}>Newly Launched</p>
                        </div>
                    ))}
                </div>
            </div>

            {/* About Developer */}
            <div style={{...styles.section, backgroundColor: '#f8f9fa'}}>
                <h2 style={styles.sectionTitle}>About Developer</h2>
                <p>{content.developer || 'High-quality development is a new idea...'}</p>

                <div style={styles.statsGrid}>
                    {['6', '1,32 LAC', '4+9', '3,77 LAC', '2,7 LAC'].map(stat => (
                        <div key={stat} style={styles.statBox}>{stat}</div>
                    ))}
                </div>

                <p><strong>Type:</strong> 18ft | <strong>Area:</strong> 380-411 RCA Sq.ft. | <strong>Price:</strong> Click for price</p>
                <button style={styles.brochureBtn}>Download Your Plan</button>
            </div>

            {/* Construction Updates */}
            <div style={styles.section}>
                <h2 style={styles.sectionTitle}>Construction Updates</h2>
                <div style={styles.updatesGrid}>
                    {[1,2].map(i => (
                        <div key={i} style={styles.updateCard}>
                            <img src="/images/construction.jpg" alt="update" style={styles.updateImg} />
                            <p>Completed House</p>
                        </div>
                    ))}
                </div>
            </div>

            {/* FAQ */}
            <div style={{...styles.section, backgroundColor: '#f8f9fa'}}>
                <h2 style={styles.sectionTitle}>Frequently Asked Questions</h2>
                <div style={styles.faqList}>
                    {[1,2,3,4,5].map(i => (
                        <div key={i} style={styles.faqItem}>
                            <p style={styles.faqQ}>‚Ä¢ What makes Beautiful Design so trusted?</p>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );
}

